shapez.enumItemProcessorTypes.iptColorRemover = "iptColorRemover";
shapez.MOD_ITEM_PROCESSOR_SPEEDS.iptColorRemover = () => 10;
shapez.MOD_ITEM_PROCESSOR_HANDLERS.iptColorRemover = function (payload) {
    const curitem = payload.items.get(0);
    if (curitem!=null) {
        if (curitem._type == "shape") {
            const shapeDefinition = curitem.definition;
            var colordrops = [];

            //remove colors from parts, collect them in array
            const newLayers = shapeDefinition.getClonedLayers();
            newLayers.forEach(layer => {
                if (layer[shapez.TOP_LEFT]!=null) {
                    colordrops.push(layer[shapez.TOP_LEFT].color);
                    layer[shapez.TOP_LEFT].color = 'uncolored';
                }
                if (layer[shapez.TOP_RIGHT]!=null) {
                    colordrops.push(layer[shapez.TOP_RIGHT].color);
                    layer[shapez.TOP_RIGHT].color = 'uncolored';
                }
                if (layer[shapez.BOTTOM_LEFT]!=null) {
                    colordrops.push(layer[shapez.BOTTOM_LEFT].color);
                    layer[shapez.BOTTOM_LEFT].color = 'uncolored';
                }
                if (layer[shapez.BOTTOM_RIGHT]!=null) {
                    colordrops.push(layer[shapez.BOTTOM_RIGHT].color);
                    layer[shapez.BOTTOM_RIGHT].color = 'uncolored';
                }
            });

            // put out layers 1/outitem
            newLayers.forEach(layer => {
                const newDefinition = new shapez.ShapeDefinition({ layers: [layer] });
                payload.outItems.push({
                    item: this.root.shapeDefinitionMgr.getShapeItemFromDefinition(newDefinition),
                    requiredSlot: 1,
                });
            });
            //put out colors
            colordrops.forEach(color => {
                if (color!='uncolored') { //colored-water-chemical??? drops
                    const newColor = new shapez.ColorItem(color);
                    payload.outItems.push({
                        item: newColor,
                        requiredSlot: 0,
                    });
                }
            });
        }
        else {
            var outslot=2;
            if (curitem._type == "color") outslot = 0;
            payload.outItems.push({
                item: curitem,
                requiredSlot: outslot,
            });
        }
    }
}

