//shapez.enumRecyclerVariants.myColorRemoverLeft = "myColorRemoverLeftVariant";
//shapez.enumRecyclerVariants.myColorRemoverRight = "myColorRemoverRightVariant";
shapez.enumRecyclerVariants = { myColorRemoverLeft: "myColorRemoverLeftVariant", myColorRemoverRight: "myColorRemoverRightVariant" };

class myColorRemover extends shapez.ModMetaBuilding {
    constructor() {
        super("myColorRemover");
    }

    static getAllVariantCombinations() {
        return [
            {
                variant: shapez.defaultBuildingVariant,
                name: "Color Remover",
                description: "Removes colors from layers, output: colors, shapes",

                regularImageBase64: RESOURCES["myColorRemover.png"],
                blueprintImageBase64: RESOURCES["myColorRemover.png"],
                tutorialImageBase64: RESOURCES["myColorRemover.png"],

                dimensions: new shapez.Vector(2, 1),
            },
            {
                variant: shapez.enumRecyclerVariants.myColorRemoverLeft,
                name: "Color Remover",
                description: "Removes colors from layers, output: colors, shapes",

                regularImageBase64: RESOURCES["myColorRemover.png"],
                blueprintImageBase64: RESOURCES["myColorRemover.png"],
                tutorialImageBase64: RESOURCES["myColorRemover.png"],

                dimensions: new shapez.Vector(2, 1),
            },
            {
                variant: shapez.enumRecyclerVariants.myColorRemoverRight,
                name: "Color Remover (Right)",
                description: "Removes colors from layers, output: colors, shapes",

                regularImageBase64: RESOURCES["myColorRemoverRight.png"],
                blueprintImageBase64: RESOURCES["myColorRemoverRight.png"],
                tutorialImageBase64: RESOURCES["myColorRemoverRight.png"],

                dimensions: new shapez.Vector(2, 1),
            },
        ];
    }

    getAvailableVariants(root) {
        var available = [ shapez.enumRecyclerVariants.myColorRemoverLeft, shapez.enumRecyclerVariants.myColorRemoverRight ];
        return available;
    }

    getDimensions(variant = defaultBuildingVariant) {
        return new shapez.Vector(2, 1);
    }

    getSilhouetteColor() {
        return "yellow";
    }

    getAdditionalStatistics(root) {
        const speed = root.hubGoals.getProcessorBaseSpeed(shapez.enumItemProcessorTypes.iptColorRemover);
        return [[shapez.T.ingame.buildingPlacement.infoTexts.speed, shapez.formatItemsPerSecond(speed)]];
    }

    getIsUnlocked(root) {
        return true;
    }

    setupEntityComponents(entity) {
/*        entity.addComponent(
            new WiredPinsComponent({
                slots: [
                    {
                        pos: new Vector(0, 0),
                        direction: enumDirection.right,
                        type: enumPinSlotType.logicalAcceptor,
                    },
                ],
            })
        );
*/
        entity.addComponent(
            new shapez.ItemAcceptorComponent({
                slots: [],
            })
        );
        entity.addComponent(
            new shapez.ItemProcessorComponent({
                inputsPerCharge: 1,
                processorType: shapez.enumItemProcessorTypes.iptColorRemover,
            })
        );
        entity.addComponent(
            new shapez.ItemEjectorComponent({
                slots: [],
            })
        );
    }

    updateVariants(entity, rotationVariant, variant) {
        switch (variant) {
            case shapez.defaultBuildingVariant:
            case shapez.enumRecyclerVariants.myColorRemoverLeft:
            {
                entity.components.ItemAcceptor.setSlots([
                        { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.bottom, }, // filter: "shape", }
                        //color-remover-liquid?? (water + e.g. white color?)
                        { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.left, filter: "liquid" },
                ]);
                entity.components.ItemEjector.setSlots([
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top},
                    { pos: new shapez.Vector(1, 0), direction: shapez.enumDirection.top},
                    { pos: new shapez.Vector(1, 0), direction: shapez.enumDirection.right},
                ]);
                break;
            }
            case shapez.enumRecyclerVariants.myColorRemoverRight:
            {
                entity.components.ItemAcceptor.setSlots([
                        { pos: new shapez.Vector(1, 0), direction: shapez.enumDirection.bottom, }, // filter: "shape", }
                        //color-remover-liquid?? (water + e.g. white color?)
                        { pos: new shapez.Vector(1, 0), direction: shapez.enumDirection.right, filter: "liquid" },
                ]);
                entity.components.ItemEjector.setSlots([
                    { pos: new shapez.Vector(1, 0), direction: shapez.enumDirection.top},
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top},
                    { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.left},
                ]);
                break;
            }
            default:
                assertAlways(false, "Unknown myColorRemover variant: " + variant);
        }
    }
}

class Mod extends shapez.Mod {
    init() {

        // Register the new building
        this.modInterface.registerNewBuilding({
            metaClass: myColorRemover,
            buildingIconBase64: RESOURCES["myRecycler.png"],
        });

        // Add it to the regular toolbar
        this.modInterface.addNewBuildingToToolbar({
            toolbar: "regular",
            location: "primary",
            metaClass: myColorRemover,
        });
    }
}


